import React, {Component} from 'react';
import SimpleReactCalendar from 'simple-react-calendar'
import './Myhabits.css'

let habits = [
    {
        id:1,
        habit:"Work Out",
        duration:30,
        commitment:5,
        startDate: Date('2019-4-24'),
        endDate: Date('2019-4-29')
    }
]

export class MyHabits extends Component {
    constructor(){
        super()
        this.state = {
            habits:habits
        }
    }
    render(){
        return(
            <div>
            return <SimpleReactCalendar activeMonth={new Date()} />
            </div>
        )
    }
}
